// * 1. Boolean
var isDone = false;

// * 2. Number
var hex = 0xf00d;
var binary = 10;

// * 3. String
var color = "blue";
color = "red";

// * 4. Array
var list = [1, 2, 3];
var list2 = ["test", "not a test", "array of strings"];

// * 7. Any
var notSure: any = 4; // ? any type is given explicitly
notSure = "maybe a string instead";
notSure = false;

// * 9. Null and Undefined
